import React, { useEffect, useState } from "react";
import { useParams, useNavigate } from "react-router-dom";
import { useTheme } from "../context/ThemeContext";
import TrainingLogManager from "./TrainingLogManager";
import TrainingLogRow from "./TrainingLogRow";

const manager = new TrainingLogManager();

export default function TrainingLogTable() {
    const { id } = useParams();
    const navigate = useNavigate();
    const { theme } = useTheme();
    const [table, setTable] = useState(null);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        const fetchTable = async () => {
            try {
                const result = await manager.loadTable(id);
                if (result) {
                    setTable(result);
                } else {
                    // If table doesn't exist, create a new one
                    const newTable = manager.createNewTable();
                    newTable.id = id; // Use the provided ID
                    setTable(newTable);
                }
            } catch (error) {
                console.error("Error fetching table:", error);
                // Create a new table if there's an error
                const newTable = manager.createNewTable();
                newTable.id = id;
                setTable(newTable);
            } finally {
                setLoading(false);
            }
        };
        fetchTable();
    }, [id]);

    const handleSave = async () => {
        if (table) {
            await manager.saveTable(table);
            alert("Log saved successfully!");
        }
    };

    const handleAddRow = () => {
        if (table) {
            const newRow = {
                id: Date.now().toString(),
                exercise: "",
                sets: "",
                reps: "",
                weight: "",
                notes: ""
            };
            setTable({
                ...table,
                rows: [...table.rows, newRow]
            });
        }
    };

    const handleDeleteRow = (rowId) => {
        if (table) {
            setTable({
                ...table,
                rows: table.rows.filter(row => row.id !== rowId)
            });
        }
    };

    const handleRowChange = (rowId, field, value) => {
        if (table) {
            setTable({
                ...table,
                rows: table.rows.map(row =>
                    row.id === rowId ? { ...row, [field]: value } : row
                )
            });
        }
    };

    const handleTableNameChange = (newName) => {
        if (table) {
            setTable({
                ...table,
                tableName: newName
            });
        }
    };

    if (loading) {
        return (
            <div style={{ 
                padding: "2rem", 
                textAlign: "center",
                background: theme.background,
                color: theme.text,
                minHeight: "100vh",
                transition: "background-color 0.3s ease, color 0.3s ease"
            }}>
                Loading...
            </div>
        );
    }

    if (!table) {
        return (
            <div style={{ 
                padding: "2rem", 
                textAlign: "center",
                background: theme.background,
                color: theme.text,
                minHeight: "100vh",
                transition: "background-color 0.3s ease, color 0.3s ease"
            }}>
                Log not found.
            </div>
        );
    }

    return (
        <div style={{ 
            padding: "2rem",
            paddingTop: "5rem",
            background: theme.background,
            minHeight: "100vh",
            color: theme.text,
            transition: "background-color 0.3s ease, color 0.3s ease"
        }}>
            {/* Back to Saved Logs Button */}
            <button
                onClick={() => navigate("/log")}
                style={{
                    position: "fixed",
                    top: "1rem",
                    left: "1rem",
                    background: theme.accentSecondary,
                    color: theme.accent,
                    padding: "0.7rem 1.4rem",
                    border: "none",
                    borderRadius: "10px",
                    fontWeight: "600",
                    fontSize: "1rem",
                    cursor: "pointer",
                    zIndex: 1000,
                    transition: "background 0.2s ease"
                }}
                onMouseOver={e => e.currentTarget.style.background = theme.accentHover}
                onMouseOut={e => e.currentTarget.style.background = theme.accentSecondary}
            >
                ‚Üê Back to Saved Logs
            </button>

            {/* Save Button */}
            <button
                onClick={handleSave}
                style={{
                    position: "fixed",
                    top: "1rem",
                    right: "1rem",
                    background: theme.primary,
                    color: "#fff",
                    padding: "0.7rem 1.4rem",
                    border: "none",
                    borderRadius: "10px",
                    fontWeight: "600",
                    fontSize: "1rem",
                    cursor: "pointer",
                    zIndex: 1000,
                    transition: "background 0.2s ease"
                }}
                onMouseOver={e => e.currentTarget.style.background = theme.primaryHover}
                onMouseOut={e => e.currentTarget.style.background = theme.primary}
            >
                Save Log
            </button>

            <div style={{ maxWidth: "1200px", margin: "0 auto" }}>
                {/* Table Name Input */}
                <input
                    type="text"
                    value={table.tableName}
                    onChange={(e) => handleTableNameChange(e.target.value)}
                    style={{
                        width: "100%",
                        padding: "1rem",
                        fontSize: "2rem",
                        fontWeight: "bold",
                        background: theme.inputBackground,
                        color: theme.text,
                        border: `1px solid ${theme.inputBorder}`,
                        borderRadius: "10px",
                        marginBottom: "2rem",
                        transition: "background-color 0.3s ease, color 0.3s ease, border-color 0.3s ease"
                    }}
                    placeholder="Enter log name..."
                />

                {/* Table Header */}
                <div style={{
                    display: "grid",
                    gridTemplateColumns: "2fr 1fr 1fr 1fr 2fr 50px",
                    gap: "1rem",
                    padding: "1rem",
                    background: theme.surfaceSecondary,
                    borderRadius: "10px 10px 0 0",
                    fontWeight: "bold",
                    border: `1px solid ${theme.border}`,
                    borderBottom: "none",
                    transition: "background-color 0.3s ease, border-color 0.3s ease"
                }}>
                    <div style={{ color: theme.text, transition: "color 0.3s ease" }}>Exercise</div>
                    <div style={{ color: theme.text, transition: "color 0.3s ease" }}>Sets</div>
                    <div style={{ color: theme.text, transition: "color 0.3s ease" }}>Reps</div>
                    <div style={{ color: theme.text, transition: "color 0.3s ease" }}>Weight</div>
                    <div style={{ color: theme.text, transition: "color 0.3s ease" }}>Notes</div>
                    <div></div>
                </div>

                {/* Table Rows */}
                <div style={{
                    border: `1px solid ${theme.border}`,
                    borderRadius: "0 0 10px 10px",
                    overflow: "hidden",
                    transition: "border-color 0.3s ease"
                }}>
                    {table.rows.map((row, index) => (
                        <TrainingLogRow
                            key={row.id}
                            row={row}
                            onDelete={handleDeleteRow}
                            onChange={handleRowChange}
                            isLast={index === table.rows.length - 1}
                        />
                    ))}
                </div>

                {/* Add Row Button */}
                <button
                    onClick={handleAddRow}
                    style={{
                        background: theme.accentSecondary,
                        color: theme.accent,
                        padding: "1rem 2rem",
                        border: "none",
                        borderRadius: "10px",
                        fontWeight: "600",
                        fontSize: "1rem",
                        cursor: "pointer",
                        marginTop: "2rem",
                        transition: "background 0.2s ease"
                    }}
                    onMouseOver={e => e.currentTarget.style.background = theme.accentHover}
                    onMouseOut={e => e.currentTarget.style.background = theme.accentSecondary}
                >
                    + Add Exercise
                </button>
            </div>
        </div>
    );
}
